import React from 'react';
import './Cabecera.css';
import yamheru from './yamheru.png';
import expansion from './expansion.png';

const Cabecera = () => {
return (

  <header className= 'di'>
<div>
    <div className='ma4'>
          <img style={{paddingTop: '5px'}} alt='logo' src={yamheru}/>
    </div>
    <div className='ma4'>
    				<img className='h2 w2' src={expansion}  alt='Expansion Icon'/>
    </div>
</div>
  </header>

);
}

export default Cabecera;
